import React, {Component} from 'react';
import AppNav from "./AppNav";
import { Container, Row, Col } from 'reactstrap';
import bgimage01 from './assets/bg-image01.png';
import profilepic from './assets/profile-pic.png';
import profilepic3 from './assets/profile-pic03.png';


const divStyle = {
    width: '100%',
    height: '800px',
    backgroundImage: `url(${bgimage01})`,
    backgroundSize: 'cover' 
  };
class Home extends Component {

    render() { 
        return ( 
            <div style={divStyle}>
                <Container>
                <AppNav />
                </Container>
                <Container>
                <Row>
                    <Col xs="10" sm="05">
                        <img src={profilepic3} className="profileImg" 
                        style={{width: 400, height: 400, borderRadius: 400/ 2}}></img>
                    </Col>
                </Row>
                </Container>
            </div>
         );
    }
}

export default Home;
